import './MyStack.css'
function MyStack(){
    return(
        <div className="info">
            <div className="frontend-info">
                <h2>Frontend</h2>
                <p>HTML, CSS, JS, ReactJs,  npm, yarn</p>
            </div>
            <div className="backend-info">
                <h2>Backend</h2>
                <p>Node Js, MySql</p>
            </div>
        </div>
    )
}

export default MyStack;
